<!DOCTYPE html>
<html>
  <head>
    <meta charset="utf-8" />
    <meta http-equiv="X-UA-Compatible" content="IE=edge" />
    <title>paginarh</title>
    <meta name="viewport" content="width=device-width, initial-scale=1" />
    <link
      rel="stylesheet"
      type="text/css"
      media="screen"
      href="./inicioserh.component.css"
    />
    <script src="main.js"></script>
  </head>
  <body>
    <header id="main-header">
      <nav>
        <ul class="list-group list-group-horizontal-xl">
            <li><a routerLink="/login"></a></li>

        </ul>
    </nav>
    </header>
      <div >
        <!--Se agrega la etiqueta "form" dentro de la cual mandaremos a llamar la funcion "onbutton()"
        esta servira cuando de clic en el boton del formulario y hara el inicio de sesion--> 
        <form [formGroup]="formlog" (ngSubmit)="onbutton()">
              <div class="card">
                <div class="card-body">
                    <!--aqui se inserta el logo del tecnologico que se puede observar en la captura-->
                    <img class="vista3" src="assets/imagenes/TESCHi.png"/>
                    <div class="form-floating">
                        <!--Aqui se realiza la estructura que tendra la pagina de inicio de sesion (botones, cajas de texto, etc.)-->
                        <input type="text" class="form-control" placeholder="Correo Institucional" formControlName="email"/>
                        <label for="floatingPassword"><i class="fa-solid fa-at" ></i>&nbsp;Correo Institucional</label>
                      </div>
                      <div class="contra">
                      <div class="form-floating">
                        <input type="password" class="form-control" placeholder="Contraseña" formControlName="password"/>
                        <label for="floatingPassword"><i class="fa-solid fa-key" ></i>&nbsp;Contraseña</label>
                      </div>
                    </div>
                      <div class="boton">
                        <button class="btn btn-outline-success" type="submit"><i class="fa-regular fa-circle-up"></i>&nbsp;Iniciar Sesión</button>
                      </div>
                </div>
              </div>
          </form>
      </div>
